//React组件
import { useState } from 'react';
import { useStore } from "@/store";
//
//图片展示
import { Card } from 'antd';
import { Image } from 'antd';
//
//Tags输入所属
//
//Antd杂项
import { Breadcrumb } from 'antd';
import { Layout } from 'antd';
import { Menu } from 'antd';
import { Button } from 'antd';
import { Form } from 'antd';
import { Space } from 'antd';//拉开组件间隔
//import { Radio } from 'antd'
import {Input} from 'antd';
import { FileOutlined, UserOutlined , DesktopOutlined , TeamOutlined , DropboxOutlined ,SearchOutlined } from '@ant-design/icons';
//Cookies
import cookie from 'react-cookies'
//
//滑动输入条
import { Col, InputNumber, Row, Slider } from 'antd';
//
//图片资源
import Wallpaper000 from '@/assets/Wallpaper000.jpg';
//

//scss文件导入 操控页面具体布局
import './index.scss';
//
//--------分割线--------//
//Tags输入所属
//
const { TextArea } = Input;
const { Content, Footer, Sider } = Layout;
const { Meta } = Card;
//储存搜索数据
//
function getItem(label, key, icon, children) 
{
  return {
    key,
    icon,
    children,
    label,
  };
}
//定义了一个items组用于储存侧栏物品
const items = [
  getItem('欢迎来到本站', '1' ,<DesktopOutlined/> ),
  getItem('使用AI', 'sub1', <UserOutlined />,  
  [
    getItem('AI绘画', 'sub2',null,[
      getItem('AI虚拟形象','7'),
      getItem('AIDrawer','8'),
    ]),
    getItem('AI建模','5'),
    getItem('AIChat','6'),
    getItem('AI音声合成','sub3',null,[
      getItem('VIP 模型训练','3'),
      getItem('声线合成','4')
    
    ]),
  ]),
  getItem('成为贡献者', '9',<DropboxOutlined />),
];
//

const Laypage = () => 
{
  const {mainStore} = useStore();
  const [inputValue, setInputValue] = useState(1);
  const onChange = (newValue) => 
  {
    setInputValue(newValue);
  };

  const [collapsed, setCollapsed] = useState(false);
  //collapsible可以设定侧栏是否可以折叠
  
  async function onFinish(values)
  {
    
    let dicTemp = 
    {
      negative_prompt:values.negative_prompt,
      prompt:values.prompt,
      seed:1,
    }
    let Token = cookie.load('Token');
    console.log(dicTemp);
    console.log(Token);
    await mainStore.getPrompts({
      token : Token,
      steps: inputValue,
      task_num : 10,
      task_detail : dicTemp,
    });  
  };
  return (
    <Layout
      style=
      {{
        minHeight: '100vh',
      }}

    >
      <Sider className='Sider' collapsible collapsed={collapsed} onCollapse={(value) => setCollapsed(value)}>
        <Menu className='FunctionMenu' defaultSelectedKeys={['1']} mode="inline" items={items} theme='dark'>
        </Menu>
      </Sider>
      <Layout className="site-layout">
        <Content
          style=
          {{
            margin: '0 20px',
          }}
        >
          <Space
            direction="vertical"
            size="middle"
            style=
            {{
              display: 'flex',
            }}
          >
            <Breadcrumb className='BreadCrumb'>
              <Breadcrumb.Item>使用AI</Breadcrumb.Item>
              <Breadcrumb.Item>AI绘画</Breadcrumb.Item>
            </Breadcrumb>
            <br />
            <br />
            <Form className='Tags'>
              <Form.Item name="prompt">
                <TextArea rows={6} placeholder="请输入AI应该采用的绘画元素" className='GoodTags'/>
              </Form.Item>
              <Form.Item name="negative_prompt">
                <TextArea rows={6} placeholder="请输入AI需要避免的绘画元素" className='BadTags'/>
              </Form.Item>
            </Form>
            <Row className='SliderInput01'>
              <Col span={20}>
                <Slider
                  min={1}
                  max={20}
                  onChange={onChange}
                  value={typeof inputValue === 'number' ? inputValue : 0}
                />
              </Col>
              <Col span={4}>
                <InputNumber
                  min={1}
                  max={20}
                  style={{
                    margin: '0 16px',
                  }}
                  value={inputValue}
                  onChange={onChange}
                />
              </Col>
            </Row>
          </Space>
          {/* 这里是生成按钮 */}
          <Button type="primary" className='GenerateButton' onClick={onFinish}>
            生成图片
          </Button>
          <Card
            hoverable
            // cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
            className="ShowImage"
          >
            {/* <Meta title="Europe Street beat" description="www.instagram.com" /> */}
            <Image src={Wallpaper000}
              height={360}
              width={680}
            > 

            </Image>
          </Card>

          

        </Content>
        <Footer
          className='Footer'
          style=
          {{
            textAlign: 'center',
          }}
        >
          TBD ©2023 Created by Yuanshin
        </Footer>
      </Layout>
    </Layout>
  );
};
export default Laypage;
